import React, { Component } from 'react';
import Header from '../Components/FixedElements/Header';
import Footer from '../Components/FixedElements/footer';
import "../Styles/shiraz.css";

const Style = {
    position: "sticky",
    top: "12%",
    background: "#ffffff8f",
    zIndex: "5",
}
export default class ResidencePage extends Component {
    componentDidMount() {
        window.scrollTo(0, 0);
    }
    render() {
        return (

            <>
                <Header
                    selectedCity={'shiraz'}
                    show={false}
                />
                <div className="siraz-wrapper">
                    <p className='topic' style={Style}>واحد مبله دو خوابه در شیراز</p>
                    <div style={{ display: "inline-flex", flexDirection: "row", width: "95%", margin: "1rem 2.5%", }}>
                        <img src={require("../Components/Images/residences/vila1.jpg")} width="50%" height="550px"/>
                        <div style={{ display: "flex", flexDirection: "column" }}>
                            <img src={require("../Components/Images/residences/vila11.webp")} width="340px" height="275px"/>
                            <img src={require("../Components/Images/residences/vila12.png")} width="340px" height="275px"/>

                        </div>
                        <div style={{ display: "flex", flexDirection: "column" }}>
                            <img src={require("../Components/Images/residences/vila13.jpg")} width="220px" height="183px"/>
                            <img src={require("../Components/Images/residences/vila14.jpg")} width="220px" height="183px"/>
                            <img src={require("../Components/Images/residences/vila15.jpg")} width="220px" height="183px"/>

                        </div>
                    </div>
                </div>
                <Footer />
            </>
        );
    }
}
